/* Sprites */
void sprites_load_all(void) 
{
	uint16_t id, ia, off_data, off_info;
	off_data = 0;
	off_info = 0;

	for (id=0; id < 5; id++) 
	{
		s[id].info.width  =  SpriteInfoMap[off_info + SPR_OFF_WIDTH];
		s[id].info.height  =  SpriteInfoMap[off_info + SPR_OFF_HEIGHT];
		s[id].info.bitres  =  SpriteInfoMap[off_info + SPR_OFF_BITRES];
		s[id].info.trans  =  SpriteInfoMap[off_info + SPR_OFF_TRANS];
		s[id].info.rotate  =  SpriteInfoMap[off_info + SPR_OFF_ROTATE];

		for(ia=0; ia < 11; ia++)
		{
			s[id].info.color_array[ia]  =  SpriteInfoMap[off_info + SPR_OFF_COLOR + ia];
		}

		s[id].data   = &SpriteMap[off_data];

		off_info += SPR_INFO_HEAD;
		off_data += s[id].info.width * s[id].info.height;
	}
}

void inline sprites_load_clut(uint16_t id)
{
	uint8_t clut_idx = 0;
	for(clut_idx=0; clut_idx<11; clut_idx++)
	{
		gpu_clut_set(clut_idx, s[id].info.color_array[clut_idx]);
	}
}


void inline sprites_draw(int16_t x, int16_t y, uint16_t id, uint16_t rotation, uint8_t crt) 
{
	unsigned int w,h;
	uint16_t x1,y1;
	uint16_t color;

	//if (x >= gfx.hres-1 || y >= gfx.vres-1 || x <= 0|| y <= 0) return;

	for (h=0; h < s[id].info.height; h++) {
		for (w=0; w < s[id].info.width; w++) {
			color = s[id].data[w + s[id].info.width*h];
			// don't draw if it matches transparency color
			//if (color == s[id].info.trans) continue;
			
			rcc_color(color);

			//rcc_color(color);
			//rcc_color(rand()); tv screen effect

			switch(rotation) {
				//  00 deg      0,0 1,0 2,0 ... 0,1
				//  90 deg CCW  7,0 7,1 7,2 ... 6,0
				// 180 deg      7,7 6,7 5,7 ... 7,6
				//  90 deg CW   0,7 0,6 0,5 ... 1,6
				case 0: // 0 degree
					x1 = x + w;
					y1 = y + (h<<crt); //h; //(h<<1);//y+(gfx.hscale*h);
					if (x1 >= gfx.hres-2) continue; //br
					if (y1 >= gfx.vres-gfx.hscale) return; //ret
					rcc_pixel(x1, y1);
					break;
				case 1: // 90 degree CW
					x1 = x+(s[id].info.width-h-1);
					y1 = y+(gfx.hscale*(w));
					if (x1 >= gfx.hres-1 || x1 <= 0) continue;
					if (y1 >= gfx.vres-gfx.hscale || y1 <= 0) continue;
					rcc_pixel(x1, y1);
					break;
				case 2: // 180 degree CW
					x1 = x+(s[id].info.width-w-1);
					y1 = y+(gfx.hscale*(s[id].info.height-h-1));
					if (x1 >= gfx.hres-1) continue;
					if (y1 >= gfx.vres-gfx.hscale) continue;
					rcc_pixel(x1, y1);
					break;
				case 3: // 90 degree CCW
					break;
				case 4:	// Scroll with 90 degree CW rotation
					// This includes magic numbers, change when not in a rush to finish demo
					//x1 = x+(s[id].info.width-h)-150;
					//y1 = y+(gfx.hscale*(w));
					y1 = gfx.hscale*(x + w);
					x1 = y + h; //h; //(h<<1);//y+(gfx.hscale*h);
					if (x1 <= gfx.hres-10 && x1 >= 20)
					{
						if (y1 <= gfx.vres-20 && y1 >= 20)
						{
							rcc_pixel(x1, y1);
						}
					}
					break;
				default:
					break;
			}
			
		}
	}
	//Nop();
}

void inline sprites_draw_angled(uint16_t x, uint16_t y, uint16_t id, float rotation) 
{
	int x1,y1,x2,y2;
	unsigned int w,h, real_x, real_y;
	uint16_t color;
	unsigned int shade = 0;
	float r_s,r_c;

	r_s = sin(rotation);
	r_c = cos(rotation);
 
	for (h=0; h < s[id].info.height; h++) {
		for (w=0; w < s[id].info.width; w++) {
			color = s[id].data[w + s[id].info.width*h];
			if (color == s[id].info.trans) continue;
			rcc_color(color+shade);

			x1 = -(s[id].info.width/2-w); // negative for origin centering 
			y1 = (s[id].info.height/2-h);
			x2 = x1*r_c - y1*r_s;
			y2 = x1*r_s + y1*r_c;

			real_x = x+sprites_nrange(x1,x2);
			real_y = y + gfx.hscale*sprites_nrange(y1,y2);

			if (real_x >= gfx.hres-1 || real_x <= 0) continue;
			if (real_y >= gfx.vres-gfx.hres || real_y <= 0) continue; // gfx.hscale for screen bordered setup
			rcc_pixel(real_x, real_y);
		}
	}
}

int inline sprites_nrange(double a, double b) 
{
	return (int)((a >= b) ? a-b : b-a);
}
